import React from 'react'
import { Container, Logo } from './Navbar.styled'

const Navbar = () => {
  return (
    <Container>
        <Logo><img src="https://i.pinimg.com/originals/58/78/fa/5878faabdbde40edd6a32228e946a120.jpg" alt="logo" /></Logo>
    </Container>
  )
}

export default Navbar
